import React, { useState } from 'react';
import './App.css';
import Login from './components/Login';

function App() {
  const [token, setToken] = useState('');

  const userLogin = (tok) => {
    setToken(tok);
  }

  return (
    <div className = 'App'>
      <Login userLogin={userLogin}/>
    </div>
  );
}

export default App;
